import React from "react";
import FeatureValue from "./FeatureValue.jsx";
function Feature(){
    const customStyle={
        display: "flex",
        flexDirection: "row"
    }
    return (
        <div class="flexcontainer" style={customStyle}>
            <FeatureValue imgsrc="../../free.svg" />
            <FeatureValue imgsrc="../../friends.svg" />
            <FeatureValue imgsrc="../../money.svg" />
        </div>
    )
}
export default Feature;
